objetoCompra:
Contratação de empresa especializada na disponibilização de local para realização de eventos (hospedagem, alimentação e auditório) conforme descrição abaixo:
* sala climatizada com capacidade para (50 pessoas) equipada com no mínimo (01) data show, tela de projeção e acesso a internet wi-fi;
* hospedagem, coffe-break e fornecimento de alimentação(café da manha, almoço e jantar) para os 05(cinco) dias do evento;

Planejamento editorial: definição do escopo do livro;
Pesquisa documental histórica: levantamento de informações dos últimos 10 anos em fontes de acervo institucional; 
Coleta de depoimentos: realização de entrevistas com até 20 pessoas;
Produção de conteúdo: redação de texto e atualização da linha do tempo com até 15 (quinze) laudas;
Revisão e adequação do conteúdo da edição anterior, referente aos primeiros 50 anos;
Editoração: organização dos elementos externos, internos e elementos de apoio.
